INSERT INTO `enterprise` VALUES (9, '广西五运科技有限公司', '2010-02-09', '计算机软件、硬件行业', '私营企业', '计算机软件、硬件服务', 4, 4, '北京市 朝阳区 ', '13878787871', '13878787871@cess.com', '华某', 'http://www.cess.com', '广西五运科技有限公司主要从事国内先进物流信息化平台的研发，致力于推动中国物流产业数字化转型，构建透明的物流生态体系。五运科技通过平台将采购、仓储、物流、财务结算、增值服务等以线上的方式紧密结合起来。基于先进的物联网、移动互联、人工智能等核心技术打造标准化、集约化、可视化的智能协同服务平台，进而帮助客户更好的适应数字化时代的发展需求，同时积极赋能上下游客户，共创新的商业价值', '物联网、移动互联、人工智能', '无', '上下游客户，共创新', '致力于推动中国物流产业数字化转型，构建透明的物流生态体系', '面谈', NULL, '2020-06-12', 3);
INSERT INTO `enterprise` VALUES (14, ' 奥盛科技集团有限公司', '1988-01-01', '计算机软件、硬件', '国有企业', '计算机软件、硬件服务', 3, 5, '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', '1387878222', '222@ee.com', '刘总2', 'http://www.cess.com', '  奥盛科技集团有限公司属下企业有广州欣彩电脑耗材有限公司（电脑耗材制造）；广州奥盛电子科技有限公司；广东奥盛医疗科技有限公司（口罩制造）；北海阿可诺电子科技有限公司（电脑耗材制造）；深圳奥欣电子技术有限公司（电子产品制造）；肯尼亚Longtron(K)Electronics Technology Co.,Ltd(电子及信息技术产品分销）；乌干达分公司；阿联酋迪拜分公司等实体企业。\n\n    其中广州欣彩电脑耗材有限公司已被广东省科技厅认定为高新技术企业，每年申请的发明专利和实用新型专利近50项,2018年将申请120项以上发明专利和实用新型专利。', '一、 电脑耗材事业部出品的Anycolor欣彩系列品牌耗材定位于高品质的通用耗材和环保耗材市场，产品包括彩色硒鼓、环保硒鼓、兼容墨盒、再生墨盒、硒鼓配件等。公司已在国内31个省市建立了营销渠道，目前在国内市场已成立成都办事处、西安办事处、湖南办事处、南京办事处、杭州办事处，并在世界上与100多个国家和地区建立了业务关系。\n\n二、 电子产品事业部研发、生产、销售智能终端外设如移动电源、数据线、充电座及特种行业手机、平板电脑等。', '公司常年参加世界各地的IT及通讯展览会：CeBIT (德国汉诺威)、Paper World/Remax（德国法兰克福）、 CES（美国拉斯维加斯）、GITEX （阿联酋迪拜）、Computex Taipei(中国台北)、 Canton Fair（中国进出口商品交易会，中国广州）等。公司计划在墨西哥、秘鲁、巴拿马、巴西、哥伦比亚、阿根廷、尼日利亚、科特迪瓦、加纳、南非、泰国、印尼、越南、土耳其、俄罗斯、美国、欧洲等国家设立分公司。', '企业愿景：公司以“信任，可依赖”为核心价值观；以“独创自有品牌、做广西专业的网络公司，成为信息时代互联网产业的领导者”为远景目标； 企业使命：以超越客户满意度为目标，提供优质的服务。为员工提供实现个人价值的平台。服务宗旨：用心服务，共创价值。质量方针：严谨务实，精益求精 。', '阿里四方网络科技在经营理念上贯彻以人为本、科技与实用结合的宗旨。\n公司拥有经验丰富的技术团队和高素质的管理核心，聚集了来自信息技术前沿阵地，在软件工程、网络工程、传统营销、新型网络媒体营销方面积累了丰富的实践经验的技术精英。公司在总经理的带领下，依靠团队的力量，把天时、地利、人和，三者结为一体；建设团队，依靠团队，和谐团队为理念，经过不断地摸索、转型、发展后，公司在营销的专注与专业，得到了社会各界的普遍认同。', '公司为员工提供免费食宿、系统的培训、完善的职业生涯发展通道、优厚的薪资待遇以及良好的工作和学习氛围，欢迎广大有志之士加入奥盛之家。\n\n \n\n以上岗位均提供免费食宿，试用期4-6K，销售岗位提成另算，海外分子公司员工年净收入10万元以上。工作日公司为员工提供早、中、晚餐，宿舍安装有空调、热水器、洗衣机。', NULL, '2020-05-28', 5);
INSERT INTO `enterprise` VALUES (16, '广州佰谦化工有限公司', '2020-06-01', '计算机软件、硬件行业', '私营企业', '计算机软件、硬件服务', 3, 4, '北京市 朝阳区 ', '13878787871', '13878787871@cess.com', '房某', 'http://www.cess.com', '广州佰谦化工有限公司，致力于功能型化学品的研究开发与应用推广，产品应用涵盖：涂料、油墨、造纸、农化、纺织、化纤、皮革、印染、日化等诸多领域，是一家集研发、生产、销售及外贸为一体的综合性企业。  ', '广州佰谦化工有限公司，致力于功能型化学品的研究开发与应用推广，产品应用涵盖：涂料、油墨、造纸、农化、纺织、化纤、皮革、印染、日化等诸多领域，是一家集研发、生产、销售及外贸为一体的综合性企业。  ', '无', ' 佰谦化工自创立以来，本着“掌握核心技术，缔造佰谦品质”的发展思路和“诚信、务实、合作、共赢”为经营理念，不断培养、挖掘相关领域人才，在未来，我们将一如既往，以铸造国内领先、国际一流的“佰谦”品质为目标，创制出更多绿色、安全、稳定、优质的精细化学品服务市场。\n    佰博待人，谦躬为业！ 佰谦全体员工，与您携手并进，共创美好未来。', ' 佰谦化工自创立以来，本着“掌握核心技术，缔造佰谦品质”的发展思路和“诚信、务实、合作、共赢”为经营理念，不断培养、挖掘相关领域人才，在未来，我们将一如既往，以铸造国内领先、国际一流的“佰谦”品质为目标，创制出更多绿色、安全、稳定、优质的精细化学品服务市场。\n    佰博待人，谦躬为业！ 佰谦全体员工，与您携手并进，共创美好未来。', '1、   收入构成：基本工资（3000-5000）+高额提成+年度奖金+期权&股权；\n\n2、  学习机会：内部培训、团队精英分享会、行业研讨会，院校联合培养；\n\n3、休闲娱乐：生日聚会、进修资助、淡季休假、业务激励假等；\n\n4、其他：适应期2个月，入职后购买社保、法定节假日以及带薪年假；', NULL, '2020-06-08', 3);
INSERT INTO `enterprise` VALUES (21, '广州城北信息科技有限公司', '2005-10-22', '计算机软件、硬件行业', '私营企业', '计算机软件、硬件服务', 3, 3, '北京市 朝阳区 ', '13878787871', '13878787871@cess.com', '某某', 'http://www.cess.com', '广州城北信息科技有限公司是一家全球领先的以移动互联网创新模式研发产品及解决方案为核心的高科技领军企业，创立于2013年，位于广州中山大学国家科技园，是中国领军的500强企业优选二维码及智慧管理、创新营销整体解决方案供应商，同时也是中国领军的腾讯社交网络服务平台中小企业精准营销服务提供商。主要从事围绕企业品牌及产品、创新营销、智慧管理打造创新型二维码技术智慧云端生态体系，通过去中心化的智慧商业、智慧管理、创新营销整体解決方案，赋能中小企业实现数字化转型升级的设计及研发。城北科技致力于产品研发和服务，助力企业向信息化、数字化转型升级，通过定制二维码管理工具，锁定行业标杆企业服务，赋能企业SaaS服务平台，实现企业和商业管理更智慧！公司曾多次获得国家、省市创新基金立项重点支持，并于2015年、2018年连续被广东省科学技术厅、广东省财政厅、广东省国家税务局及广东省地方税务局共同认定为高新技术企业以及科技小巨人企业的认定，公司拥有独立自主的知识产权体系，截止目前拥有各类专利、软著版权、商标等达300余项。公司目前旗下拥有企业推广、产品推广、电子画册、售后管理、一物一码创新营销、物联网设备、防伪溯源、社交电商系统、建筑施工、设备巡检、物业管理、固定资产管理等二维码全产业链解决方案和企业智库，通过一体化、模块化、定制化、扩展化、全过程、全周期、全场景、全保障系统帮助客户在新零售及智慧管理时代提高企业形象、运营效率和盈利能力，降低企业运营成本等多种智能化高新产业。', '主要从事围绕企业品牌及产品、创新营销、智慧管理打造创新型二维码技术智慧云端生态体系，通过去中心化的智慧商业、智慧管理、创新营销整体解決方案，赋能中小企业实现数字化转型升级的设计及研发。城北科技致力于产品研发和服务，助力企业向信息化、数字化转型升级，通过定制二维码管理工具，锁定行业标杆企业服务，赋能企业SaaS服务平台，实现企业和商业管理更智慧！公司目前旗下拥有企业推广、产品推广、电子画册、售后管理、一物一码创新营销、物联网设备、防伪溯源、社交电商系统、建筑施工、设备巡检、物业管理、固定资产管理等二维码全产业链解决方案和企业智库，通过一体化、模块化、定制化、扩展化、全过程、全周期、全场景、全保障系统帮助客户在新零售及智慧管理时代提高企业形象、运营效率和盈利能力，降低企业运营成本等多种智能化高新产业。', '公司曾多次获得国家、省市创新基金立项重点支持，并于2015年、2018年连续被广东省科学技术厅、广东省财政厅、广东省国家税务局及广东省地方税务局共同认定为高新技术企业以及科技小巨人企业的认定，公司拥有独立自主的知识产权体系，截止目前拥有各类专利、软著版权、商标等达300余项。', '多年来，城北科技在二维码开发及场景应用、服务等方面始终保持中国业界领先地位并已与华为、腾讯、阿里云、百度、新浪、今日头条、中山大学、深圳潮汕商会等产生深度链接及合作。旗下依美二维码是国内领先的二维码研究与运用TOP品牌，全场景全链路的SaaS产品，其二维码云服务涵盖了智能防伪追溯、数码科技、家居建材、快消品、电器、汽车及零部件制造、医疗器械、化妆品、共享设备、工程建筑、媒体广告、物流、地产等多个行业，累计服务经验次数100000+，累计输出二维码超10亿个，在线用户日均扫码量超500000+，在为客户实现企业管理数字化、操作标准化、覆盖全员化，共享网络化提供更多的应用选择和服务，深受广大用户的好评和信赖。目前城北科技已与欧派家居、中交集团、中铁集团、中建集团、深圳高速、万科、蓝月亮 、碧生源、白云山、同仁堂、云南白药、仁和、哈药集团、华西集团、珠江物业、广西建工、龙发装饰、鲁能地产、中海地产、新中源集团、中集集团、福建六建等上千家知名的企业和机构建立深度合作和项目服务。', '多年来，城北科技在二维码开发及场景应用、服务等方面始终保持中国业界领先地位并已与华为、腾讯、阿里云、百度、新浪、今日头条、中山大学、深圳潮汕商会等产生深度链接及合作。旗下依美二维码是国内领先的二维码研究与运用TOP品牌，全场景全链路的SaaS产品，其二维码云服务涵盖了智能防伪追溯、数码科技、家居建材、快消品、电器、汽车及零部件制造、医疗器械、化妆品、共享设备、工程建筑、媒体广告、物流、地产等多个行业，累计服务经验次数100000+，累计输出二维码超10亿个，在线用户日均扫码量超500000+，在为客户实现企业管理数字化、操作标准化、覆盖全员化，共享网络化提供更多的应用选择和服务，深受广大用户的好评和信赖。目前城北科技已与欧派家居、中交集团、中铁集团、中建集团、深圳高速、万科、蓝月亮 、碧生源、白云山、同仁堂、云南白药、仁和、哈药集团、华西集团、珠江物业、广西建工、龙发装饰、鲁能地产、中海地产、新中源集团、中集集团、福建六建等上千家知名的企业和机构建立深度合作和项目服务。', '等', NULL, '2020-06-12', 2);
INSERT INTO `enterprise` VALUES (22, '深圳可立克科技股份有限公司', '2015-11-12', '计算机软件、硬件行业', '私营企业', '计算机软件、硬件服务', 1, 2, '北京市 朝阳区 ', '13878787871', '13878787871@cess.com', '某某', 'http://www.cess.com', '深圳可立克科技股份有限公司成立于1995年，坐落于深圳市宝安区，是一家在电源和磁性元件领域内快速成长且具有高增长性的高新技术企业。2015年12月在深交所A股挂牌上市（简称：可立克，股票代码：002782）。公司专业从事特种磁性元件及电源产品的研发、设计、生产、销售和服务，分别在上海、中国台湾、中国香港、美国等地设有分公司和办事处，在广东惠州、广东清远、江西赣州设有三大生产基地，拥有百条以上磁性元件生产线和数十条电源生产线，具年产磁性元件15亿只、电源3亿只以上的生产能力。公司70%产品远销东南亚、澳洲和欧美地区，是亚太乃至国际市场有影响力的磁性元件和电源厂商之一。', '磁性元件（变压器）类：开关电源变压器系列、电源变压器系列、扼流圈系列、滤波器系列、贴片电感、通迅变压器系列、逆变器系列、平面变压器系列、棒形电感系列、工字电感系列；\n\n电源类：适配器、LED电源、通讯电源、工业电源、电力仪表电源、智能逆变电源；', '可立克已通过ISO9000、TS16949、ISO14001、ISO14064和BABT等国际标准化体系认证。在技术和工艺上，紧跟国际行业技术前沿，兼收并蓄，不断引进和吸收先进技术和设计理念。研发中心已成为区级技术中心，拥有一整套现代化的电源验证和检测实验室，研发技术人才300多人，年实现研发项目3000个以上，每年获得多项专利。', '1、企业愿景：通过提供优质的产品和服务，成为世界一流的电子零件及设备制造厂商。\n\n2、核心价值观：卓越、创新、坦诚、分享\n\n我们追求卓越的成就与贡献，我们凭借创新打造竞争优势，我们依靠诚实守信、真诚沟通赢得顾客信赖，我们倡导与客户、股东、员工分享成果。\n\n3、企业精神：自强不息，厚德载物；全力以赴，永不懈怠\n\n我们主张做事先做人，做人就应奋发图强，勇往直前，争创一流的品格，以深厚的德泽待人接物；做事就应把全部精力都投入到工作中去，持续不断，毫不松散和怠慢，唯有付出不亚于任何人的努力，才能有所作为。\n\n4、经营理念：以客户需求为导向，保持技术领先，为客户、员工、股东创造价值，贡献社会。', '五', '无', NULL, '2020-06-15', 3);
INSERT INTO `enterprise` VALUES (24, '凹凸科技', '1995-10-04', '计算机软件、硬件行业', '私营企业', '计算机软件、硬件服务', 4, 4, '北京市 朝阳区 ', '13878787871', '13878787871@cess.com', '莫某', 'http://www.cess.com', '凹凸科技（O2Micro Inc）1995年4月15日在开曼群岛注册成立，于2000年正式在纳斯达克上市（Nasdaq：OIIM）。作为全球第一家由华人创立、以中国研发设计团队为核心的IC设计公司，凹凸科技致力于设计、开发和销售应用于通讯、计算机、消费电子、工业和汽车领域的电源管理系统。O2Micro的分支机构遍布美洲、欧洲及亚洲等全球13个国家和地区，公司于2000年进驻中国大陆，先后在武汉、北京、上海、深圳和成都设立研发中心。', '凹凸科技是一家专业从事集成电路研发设计的高科技公司，是全球电源管理、电池管理、LED背光、LED照明等领域的技术领导企业。凹凸科技拥有全球领先的电源管理系统架构、丰厚的专利积累、快速的市场响应能力、极其严密谨慎的品质管控、牢固的客户关系及在业内良好的声誉，将为客户持续提供高质量、高可靠度的产品。', '无', '凹凸科技始终秉承着以人为本的管理理念，重视人才的发展和培养，通过开展丰富多彩的培训项目，无限新意的团建活动，最大限度的为员工打造施展才华的成长环境，让员工在追梦的道路上，以梦为马，不负韶华！', '凹凸科技始终秉承着以人为本的管理理念，重视人才的发展和培养，通过开展丰富多彩的培训项目，无限新意的团建活动，最大限度的为员工打造施展才华的成长环境，让员工在追梦的道路上，以梦为马，不负韶华！', '无', NULL, '2020-06-18', 4);
INSERT INTO `enterprise` VALUES (27, '上海道多生物科技有限公司', '2013-06-17', '计算机软件、硬件行业', '私营企业', '计算机软件、硬件服务', 5, 4, '北京市 朝阳区 ', '13878787871', '13878787871@cess.com', '沈某', 'http://www.cess.com', '上海道多生物科技有限公司是上海交通大学微生物代谢国家重点实验室科技成果产业化的技术型企业，专业从事以微生物代谢的方法和手段综合治理空气中有毒有害气体、挥发性有机物（VOCs）及恶臭气体的污染。 公司拥有强大的科技研发团队, 研发人员占公司总人数的30%，均为博士研究生。', '产品具备自有的知识产权专利，经过中国科学院微生物研究所检测备案，通过上海环境检测中心、上海交通大学微生物代谢国家重点实验室、上海化工研究院检测中心、上海实朴检测技术服务有限公司安全及效果检测。 产品广泛应用于生活垃圾中转站、垃圾压缩站、垃圾转运站、垃圾填埋场、垃圾焚烧场、垃圾场污泥、污水的臭气处理，以及饲料厂、海产品加工、生禽处理厂、生物发酵、养殖业等企业的综合治理空气中有毒有害气体、挥发性有机物（voc)及恶臭气体的污染。公司还拥有丰富的微生物恶臭治理经验，注重技术创新，并拥有专业的设备及专业的服务团队。', '无', '无', '致力于在环境污染物处理领域中打造一个生物修复科技领先的公司。 企业使命：要像对贫困宣战一样，坚决向污染宣战，实施环境污染物微生物处理计划。推进重点领域污染治理，给环境一个安全的保障。 公司宗旨：环卫人是环境的美容师、环境安全的守护者，但长期以来，环卫人一直都在有毒有害气体、挥发性有机 物（VOC）及恶臭气体的环境下工作，恶劣的空气环境长期对环卫人的身心进行侵害，环卫人！你们守护着环境的安全，道多人的宗旨是守护你们的安全！', '1、基本工资+ 绩效奖金（项目提成） ；\n\n2、五险一金；\n\n3、带薪年假；\n\n4、弹性工作制、扁平化管理。', NULL, '2020-06-18', 3);
INSERT INTO `enterprise` VALUES (29, '广州立功科技股份有限公司', '2009-06-17', '计算机软件、硬件行业', '私营企业', '计算机软件、硬件服务', 4, 2, '北京市 朝阳区 ', '13878787871', '13878787871@cess.com', '刘某某', 'http://www.cess.com', 'ZLG下属有立功科技和致远电子两家企业。\n\n广州立功科技股份有限公司成立于1999年，面向工业、汽车电子用户提供芯片和智能物联解决方案，为客户提供从选型评估、开发设计、测试认证到量产防伪，贯穿产品全生命周期的专业技术与服务。ZLG立功科技在国内设有22个销售机构、2个技术研发中心，为客户和供应商提供卓越价值。\n\n广州致远电子有限公司创立于2001年，作为工业互联网产品与解决方案供应商，专注服务工业领域企业类用户，提供从感知控制、互联互通、边缘计算到ZWS云平台的产品与系统化方案，与生态伙伴开放合作，为客户创造价值。目前ZLG致远电子有700余名员工，其中近50%从事研究与开发工作，坚持围绕客户需求持续创新，推动行业进步，创造社会价值。', 'ZLG下属有立功科技和致远电子两家企业。\n\n广州立功科技股份有限公司成立于1999年，面向工业、汽车电子用户提供芯片和智能物联解决方案，为客户提供从选型评估、开发设计、测试认证到量产防伪，贯穿产品全生命周期的专业技术与服务。ZLG立功科技在国内设有22个销售机构、2个技术研发中心，为客户和供应商提供卓越价值。\n\n广州致远电子有限公司创立于2001年，作为工业互联网产品与解决方案供应商，专注服务工业领域企业类用户，提供从感知控制、互联互通、边缘计算到ZWS云平台的产品与系统化方案，与生态伙伴开放合作，为客户创造价值。目前ZLG致远电子有700余名员工，其中近50%从事研究与开发工作，坚持围绕客户需求持续创新，推动行业进步，创造社会价值。', '无', '无', 'ZLG下属有立功科技和致远电子两家企业。\n\n广州立功科技股份有限公司成立于1999年，面向工业、汽车电子用户提供芯片和智能物联解决方案，为客户提供从选型评估、开发设计、测试认证到量产防伪，贯穿产品全生命周期的专业技术与服务。ZLG立功科技在国内设有22个销售机构、2个技术研发中心，为客户和供应商提供卓越价值。\n\n广州致远电子有限公司创立于2001年，作为工业互联网产品与解决方案供应商，专注服务工业领域企业类用户，提供从感知控制、互联互通、边缘计算到ZWS云平台的产品与系统化方案，与生态伙伴开放合作，为客户创造价值。目前ZLG致远电子有700余名员工，其中近50%从事研究与开发工作，坚持围绕客户需求持续创新，推动行业进步，创造社会价值。', '无', NULL, '2020-06-18', 4);
INSERT INTO `enterprise` VALUES (30, '桂林长海发展有限责任公司', '2010-06-15', '计算机软件、硬件行业', '私营企业', '计算机软件、硬件服务', 5, 3, '北京市 朝阳区 ', '13878787871', '13878787871@cess.com', '苏某某', 'http://www.cess.com', '桂林长海发展有限责任公司建于1966年，是军工国有独资企业，隶属央企中国电子信息产业集团（全球500强），致力于电子对抗装备研制，是一家集科研、生产、销售于一体的国际国内双线发展的高新技术型企业，是国家军品重点单位，产品覆盖各军兵种并远销国际，为国防现代化建设作出了重要贡献。', '北京、成都研发中心；区级技术中心；博士后科研工作站；一批国家级型研和预研项目，一批国家级发明专利和新型技术专利；国内少数几家电子对抗装备科研生产的骨干企业；我国第一代雷达电子对抗装备的制造企业；国家军用电子产品重要的科研生产基地。', '北京、成都研发中心；区级技术中心；博士后科研工作站；一批国家级型研和预研项目，一批国家级发明专利和新型技术专利；国内少数几家电子对抗装备科研生产的骨干企业；我国第一代雷达电子对抗装备的制造企业；国家军用电子产品重要的科研生产基地。', '公司注重青年员工的培养与发展，技术、管理各职业生涯通道完备，为人才成长提供了良好的工作、生活环境以及晋升和培训机会，为各类人才提供了优质的发展平台和广阔的发展空间。公司处于著名的芦笛风景区内，环境优美，形成了宿舍、食堂、医院、学校、文体场馆等设施完备的生活环境，为员工提供集资建房、继续教育资金扶持等优厚的从业条件。', '公司注重青年员工的培养与发展，技术、管理各职业生涯通道完备，为人才成长提供了良好的工作、生活环境以及晋升和培训机会，为各类人才提供了优质的发展平台和广阔的发展空间。公司处于著名的芦笛风景区内，环境优美，形成了宿舍、食堂、医院、学校、文体场馆等设施完备的生活环境，为员工提供集资建房、继续教育资金扶持等优厚的从业条件。', '（本地域前列）博士25-30w/年（安家费5w，解决住房），硕士15w-25w/年起（安家费1-2万元，免费住宿），本科研发岗10-15w/年起；五险一金；餐补、保密、交通、职称、海外等各类补贴；提供住房（单身公寓、公租房、集资房）；体检/年；节假日礼品礼金；文体活动丰富，文体场馆、设施齐备。\n\n市人才政策：人才津贴4-8万、购房补贴15-30万、租赁补贴500-1000/月，就学就医优先服务等。\n', NULL, '2020-06-12', 3);
