INSERT INTO `experience_project` VALUES (1, '2020-01-29', '2020-03-29', '旅游信息爬虫系统', 'Idea，postman，n', 'Spring、SpringMVC、MyBatis、WebMagic、jsp、MySql', '略', 1, '基于爬虫框架 WebMagic，通过单元测试对携程网上各个模块的数据进行爬取，通过分析页面链接结构，进行部分页面数据的舍弃，通过 WebMagic 多线程并发采集，比如首先爬取所有城市，再爬取通过 url 进入一个城市采集景点列表数据等，对于景点评论的爬取遇到一定困难，由于这部分数据是通过跨域地异步请求动态加载的，需要自定义请求方式。\n对于网络波动等原因导致的无法采集情况，通过分析日志抽取失败的 url 以及对应异常，对症下药重新爬取。另外对于大量图片的存储，是对应携程网上图片的绝对 url，有层次的分目录存储以便后期查找展示。\n对采集到的数据，采用 jsp 展示，其中大量使用了 jstl 和 JQuery 进行页面的渲染，自己实现翻页、Ajax 等组件。', '个人项目，前后端全部负责');
