INSERT INTO `position` VALUES (1, '班干部', '班长、副班长（有的学校分为男女班长）、学习委员、纪律委员、文艺委员、体育委员、宣传委员、生活委员（或劳动委员）、女生委员、心理委员（近年大学里较为常见）、科代表等。');
INSERT INTO `position` VALUES (2, '学生会干部', '主席、副主席、秘书长，各部（学习部、纪律部、劳动部、文艺部、体育部、女生部、生活部、网络部等）部长、副部长，各部（学习部、纪律部、劳动部、文艺部、体育部、女生部、生活部、网络部等）的处长、副处长，干事、预备干事等。');
INSERT INTO `position` VALUES (3, '学生科学技术协会干部', '主席（理事长）、副主席（副理事长）、秘书长（理事）、各部（秘书处、宣传部、论坛部、科技活动部、项目管理部、外联部、家电维修部等）部长、副部长、委员（干事）等。');
INSERT INTO `position` VALUES (4, '大自委干部', '主席、副主席、各部（办公室、公寓管理、勤工助学、学生建设（学业促进）、心理帮扶、文化（文艺）宣传）部长、副部长、干事、见习干事等。');
INSERT INTO `position` VALUES (5, '社团干部', '主席、副主席、各部（办公室、公寓管理、勤工助学、学生建设（学业促进）、心理帮扶、文化（文艺）宣传）部长、副部长、干事、见习干事等。');
INSERT INTO `position` VALUES (6, '团支部', '团支部书记、团支部副书记、组织委员、宣传委员等。');
INSERT INTO `position` VALUES (7, '新闻宣传干部', '新闻宣传干部多隶属于校党委宣传部的大学生记者团或者学生通讯社等，帮助老师进行学校新闻宣传或校报等工作，新闻宣传干部：包括主席（或团长、社长）、总编、主编、理事长、各部部长、学生记者等。');
INSERT INTO `positions` VALUES (1, '中级JAVA工程师', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼', 3, 5, 5, '1、3年以上java服务器端软件开发经验，具有扎实的Java编程功底和良好的编码习惯 \r\n2、熟悉MySQL的使用以及SQL优化，有大规模高并发环境下MySQL优化经验优先。 \r\n3、熟悉Redis等NoSQL技术 \r\n4、熟练掌握Spring、Spring Boot、Mybatis等主要技术框架； \r\n5、熟悉HTML、CSS、XML、JSON等技术，熟练掌握JS/JQuery, AJAX等前端技术 \r\n6、熟悉Linux、git相关基础知识 \r\n7、良好的沟通能力，有团队合作合作精神，责任心强 \r\n8、熟悉Docker，有微服务开发经验者优先', 2, 4, ' Java SpringBoot vue', '2020-06-06', 1);
INSERT INTO `positions` VALUES (2, '初级JAVA工程师', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼', 6, 5, 2, '1、3年以上java服务器端软件开发经验，具有扎实的Java编程功底和良好的编码习惯 \r\n2、熟悉MySQL的使用以及SQL优化，有大规模高并发环境下MySQL优化经验优先。 \r\n3、熟悉Redis等NoSQL技术 \r\n4、熟练掌握Spring、Spring Boot、Mybatis等主要技术框架； \r\n5、熟悉HTML、CSS、XML、JSON等技术，熟练掌握JS/JQuery, AJAX等前端技术 \r\n6、熟悉Linux、git相关基础知识 \r\n7、良好的沟通能力，有团队合作合作精神，责任心强 \r\n8、熟悉Docker，有微服务开发经验者优先', 2, 7, 'JavaScript Java SpringBoot vue', '2020-04-18', 1);
INSERT INTO `positions` VALUES (4, '高级java工程师', '深圳市南山区', 6, 5, 5, '1、3年以上java服务器端软件开发经验，具有扎实的Java编程功底和良好的编码习惯 \r\n2、熟悉MySQL的使用以及SQL优化，有大规模高并发环境下MySQL优化经验优先。 \r\n3、熟悉Redis等NoSQL技术 \r\n4、熟练掌握Spring、Spring Boot、Mybatis等主要技术框架； \r\n5、熟悉HTML、CSS、XML、JSON等技术，熟练掌握JS/JQuery, AJAX等前端技术 \r\n6、熟悉Linux、git相关基础知识 \r\n7、良好的沟通能力，有团队合作合作精神，责任心强 \r\n8、熟悉Docker，有微服务开发经验者优先', 2, 2, 'java vue SpringBoot JavaScript ', '2020-04-18', 1);
INSERT INTO `positions` VALUES (5, 'Android/IOS', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 5, 5, 5, '1、负责社区产品的研发和性能优化，完成高质量编码和测试；\n2、负责与产品同学配合，深度参与产品需求讨论和功能定义；\n3、负责参与移动技术框架的设计选型，实现关键技术点；\n岗位要求：\n1、本科及以上学历，2年以上Android/iOS开发经验； 熟练使用Git，Android Studio/XCode及性能调优工具；\n2、熟练使用Android/iOS常用API，理解系统体系结构及UI绘制原理；\n3、精通Java/Obj-C多线程开发，熟悉Http/Socket工作原理，常用数据交换格式；\n4、积极乐观，责任心强，具有良好的团队沟通与协作能力；\n5、有系统源码研究、架构设计及自定义UI控件经验优先；\n6、有较好的产品思维优先；', 2, 4, 'UI控件 系统源码 ui绘制 Android Studio', '2020-04-18', 1);
INSERT INTO `positions` VALUES (7, '游戏策划', '北京朝阳区闲徕互娱公司朝阳区红军营南路西口汇中广场', 5, 5, 4, '1. 负责游戏主体框架结构设计，设定核心玩法和系统规则；\n2. 负责用户日常游戏目标，产出、消耗等系统的规划和整体设计；\n3. 制定项目进度，安排、监督、指导下属策划的工作，协调技术完成对应开发内容，推动项目开发工作顺利进行；\n4. 负责提及把控输出策划设计方案的质量和效率；\n5. 把控游戏的产品质量、美术风格、技术要求等产品关键指标。\n任职要求：\n1. 3年以上游戏策划经验，有0-1的过程；\n2. 对游戏有深刻的认识和理解，游戏经验丰富，熟悉多种类型游戏；\n3. 良好的沟通、理解和语言表达能力，文字功底扎实，逻辑敏捷、思维清晰；\n4. 性格开朗、情绪稳定，工作积极主动，较好的工作抗压能力；\n5. 有桌游或棋类游戏开发经验者优先。', 2, 2, '核心玩法 游戏经验 美术风格 桌游 框架结构设计', '2020-04-18', 1);
INSERT INTO `positions` VALUES (8, '测试开发工程师 ', '深圳市南山区', 8, 5, 5, '工作职责：\n1、根据需求设计测试用例，对需求有一定的敏感度；\n2、参与Web和App等方向的接口、功能测试工作，提交缺陷并进行验证，积极推动并协助开发人员跟踪、重现、修正缺陷；\n3、熟悉jemter工具能熟练使用工具进行接口及性能测试并对测试结果进行分析；\n4、学习掌握需求的测试工具及新技术，并运用到实际的工作中。\n5、熟悉接口自动化，并运用到实际的工作中提高工作效率。\n任职资格：\n1、计算机、软件等相关专业，有性能测试或Web以及app接口自动化测试经验者优先；\n2、熟悉Java/python等至少一种编程语言，熟练使用一种脚本语言；\n3、熟悉Linux或类unix的系统，能够熟练使用常见的命令，对操作系统原理熟悉优先；\n4、熟悉数据库原理，能够熟练使用常见的SQL语句，对Mysql性能优化有经验优先；\n5、有良好的团队合作意识、沟通表达能力和协调能力,能够承受一定压力。', 2, 3, '系统架构 后端开发 搜索架构 unix平台 网络编程', '2020-04-29', 1);
INSERT INTO `positions` VALUES (9, '高级java开发工程师（银行系统）', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 8, 5, 7, '1.熟练掌握JAVA语言；\n2.熟练掌握Spring开发，能够在Spring/Spring boot/Spring等开发框架下开发应用；\n3.熟悉Linux常用命令,掌握在Linux下进行开发部署测试； \n4.掌握基于Oracle、Mysql等关系型数据库的模型设计与开发；\n5.了解HTML、JS、JSP、CSS等前端框架； \n6.能够使用IDEA/Eclipse、Git/ClearCase或同类开发及版本管理工具； \n7.熟悉软件的分析、设计、开发、测试（单元测试，组件测试）、部署和运维基本知识，具备相关经验者从优录用；\n8.有银行、保险、基金、积分相关从业经验者从优录用', 2, 2, 'java vue SpringBoot JavaScript ', '2020-06-04', 1);
INSERT INTO `positions` VALUES (16, 'Android/ios客户端开发工程师', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼', 6, 5, 5, '岗位职责：\n\n1、负责混合式移动APP的开发；\n\n2、对现有的移动APP进行优化，包括优化APP性能，提升APP的用户体验；\n\n3、积极响应客户需求并进行开发/定制化开发和交付；\n\n4、参与公司产品的架构优化，性能优化并辅助其他模块进行技术实现；\n\n5、协助并完成其他各类技术开发任务。\n\n\n\n任职资格：\n\n1、全日制大学本科及以上学历，35周岁以下；\n\n2、计算机类相关专业；\n\n3、有相关行业工作经验；\n\n4、精通Javascript、HTML5、CSS，有混合开发经验者优先；\n\n5、熟悉Android及iOS平台应用开发，熟悉常用布局，了解设计规范；\n\n6、熟悉Android及iOS 操作系统体系结构、framework、以及底层库；\n\n7、具备一定的移动端系统分析和系统架构设计能力。\n\n优先条件:\n\n1、有智能POS前端APP开发经验者优先；\n\n2、有手机APP开发经验者优先。\n\n', 2, 4, 'UI控件 系统源码 ui绘制 Android Studio', '2020-06-04', 1);
INSERT INTO `positions` VALUES (17, '前端高级开发工程师', '深圳市南山区', 6, 5, 5, '1.负责平台类产品的Web前端研发；\n\n2.负责产品体验、性能改进和Web界面技术优化；\n\n3.探索数据可视化、多维分析等领域在大数据产品上的应用', 2, 3, ' HTML5 css', '2020-06-04', 1);
INSERT INTO `positions` VALUES (18, 'VR/AR内容制作岗', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 5, 6, 6, '1、根据项目要求制作符合VR/AR展示的场景、模型；\n\n2、完成项目中的模型、材质、纹理贴图制作；\n\n3、完成与后期制作的沟通，确保交付最终VR/AR产出物', 2, 3, ' 3D Max PS', '2020-06-04', 1);
INSERT INTO `positions` VALUES (19, '高级ui设计师', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼', 5, 5, 7, '1. 负责移动端和Web端的UI设计工作，能独立且高品质地完成产品设计任务；\n\n2. 系统化的进行用户需求的调研和分析，参与相关设计流程、设计标准以及视觉元素规范的制定，持续跟进产品的交互、视觉体验优化；\n\n3. 理解业务背景，快速捕捉业务目标，提出产品设计方案和完成UI设计稿，协同上下游推动项目落地，并根据数据及反馈结果，持续优化；\n\n4. 将自己的设计作品及创作过程转述成设计成果，定期进行同行设计竞品案例总结，结合设计与创意的流行趋势，主动发现、思考产品设计存在的问题并积极推进用户体验改善计划', 2, 2, ' UI 视觉', '2020-06-04', 1);
INSERT INTO `positions` VALUES (20, '区块链应用开发工程师', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼', 3, 5, 6, '负责面向不同应用场景的区块链应用开发和测试。\n\n开发区块链智能合约及相关的开发区块链应用服务。\n\n负责开发行业应用的区块链SaaS服务', 2, 2, ' 银行 python Java', '2020-06-04', 1);
INSERT INTO `positions` VALUES (25, '高级java开发工程师', '深圳市南山区', 6, 5, 7, '岗位职责：\n\n1、根据客户需求，在规定的工期与质量要求下，进行产品模块级或功能级的设计与编码，为项目交付提供保障；\n\n2、在Devops工程指导思想下，与开发上下游密切协作，参与单元测试、各环节评审等质量保障工作，不断提升产品的品质，提升用户体验；\n\n3、解决客户在使用产品过程中遇到的技术疑难问题。\n\n \n\n工作要求：\n\n1、计算机或相关专业，全日制统招一本以上；5年及以上工作经验；\n\n2、精通java开发技术，掌握微服务知识及相关技术框架（如Dubbo等），且有相关的项目经验及分布式开发实践；\n\n3、掌握数据库原理，至少具有5年及以上MySQL、Oracle、sql server等其中一种数据库在大型系统中的使用经验；\n\n4、熟悉js、html5、css等前端技术；\n\n5、富有创新意识，善于思考，具有优秀的解决问题能力、良好的组织沟通能力及团队协作精神；\n\n6、能够较好地践行DevOps思想或具有人力资源系统开发经验者优先考虑。', 2, 2, ' Mysql java 云计算', '2020-06-04', 1);
INSERT INTO `positions` VALUES (26, '高级java开发工程师', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 6, 5, 6, '岗位职责：\n\n1、在运营领域能独当一面，具有技术牵引驱动业务的能力，能在业务和技术上指导其他同学；\n\n2、愿意接受B端业务逻辑复杂性、海量数据、服务高可用的挑战，推动系统可用性和可扩展性的提升；\n\n3、具有良好的系统抽象能力，在系统中台能力建设方面能提出创新的解决思路和方案，为团队引入创新技术。\n\n岗位要求：\n\n1、计算机或相关专业本科以上学历，有扎实的计算机基础知识和编程功底，5年及以上相关工作经验；\n\n2、有较强的问题解决能力，根据不同的场景可以给出较优的系统解决方案；\n\n3、精通多线程编程，熟悉JVM，熟悉常见的开源分布式中间件、缓存、消息队列等，熟悉MySQL，熟悉大数据处理、olap等，熟悉Linux下的DevOps； \n\n4、有较强的团队沟通协作能力和项目风险管理能力，可以push多团队协作按时交付项目；\n\n5、有丰富的系统架构设计经验，在一线互联网公司负责B端中台建设经验者优先，业务sense良好者优先。', 2, 2, ' 中间件 Linux Java', '2020-06-04', 1);
INSERT INTO `positions` VALUES (27, '高级java开发工程师 ', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼', 5, 5, 7, '岗位要求：\n\n1、Java开发经验5年\n2、使用过dubbo，reids，对分布式有了解\n3、最近项目工作超1年\n\n4、统招本科及以上学历，学信网可查', 2, 4, ' 后端 中间件', '2020-06-04', 1);
INSERT INTO `positions` VALUES (28, '技术运营实习生 ', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼', 5, 5, 3, '职位职责： \n1、技术培训的支持，需求收集、讲师沟通、课程打磨等培训工作； \n2、技术活动的落地，策划、宣传、组织、复盘等设计工作； \n3、视频课程的后期，剪辑视频、线上发布及运营等维护工作； \n4、完成上级安排的其他工作。 \n\n职位要求： \n1、具备良好的协调、沟通和抗压能力； \n2、做事踏实、细致、认真，执行力强； \n3、熟练使用办公软件，有后期制作基础、Pr、AE、PS、AI至少能熟练操作其中两项； \n4、本科及以上学历，大三及研究生优先； \n5、一周可工作4天以上，并可长期实习（3个月及以上）', 4, 4, ' 技术运营 实习', '2020-06-04', 1);
INSERT INTO `positions` VALUES (29, '游戏技术美术（TA）', '深圳市南山区', 8, 5, 3, '岗位职责：\n\n1、 学习基础游戏美术制作流程及能力；\n\n2、 与美术及程序团队沟通，用引擎实现游戏中美术表现及功能；\n\n3、 学习项目美术工作流程或制作相应美术工具或插件；\n\n4、 能够完成一些基础的设计工作，美术资源输出及最终效果优化。\n\n任职要求：\n\n1、统招2020届本科/研究生，数字媒体技术或动画等专业，热爱游戏行业；\n\n2、有一定的unity使用经验，较好的造型，色彩能力，设计能力；\n\n3、做事踏实，头脑灵活，学习能力强；\n\n4、沟通能力/抗压能力强。\n\n', 2, 2, ' 美术设计', '2020-06-04', 1);
INSERT INTO `positions` VALUES (30, '研究院技术项目经理实习生', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 8, 5, 3, '岗位职责】\n\n1、 协助项目经理进行深度学习平台产品开发工作流程的梳理、制定 版本迭代规划\n\n2、对研发中的项目进度跟踪、项目信息同步和风险管理等，保障项目版本目标达成\n\n3、参与深度学习平台产品的体验优化工作，设计产品体验方案并完成用户需求的搜集和转化\n\n\n\n【岗位要求】\n\n1、本科或本科以上学历，计算机或管理类相关专业\n\n2、了解人工智能基本概念\n\n3、责任心强、细致有耐心、逻辑清晰、有良好的沟通能力\n\n4、每周至少出勤4天，全勤优先（特殊情况可酌情请假）\n\n5、有项目管理经验者优先', 4, 3, ' 项目管理', '2020-06-04', 1);
INSERT INTO `positions` VALUES (31, '储备技术员', '深圳市南山区', 6, 4, 3, '一、公司简介\n\n我们是一家大型国有央企，隶属世界500强，中国电子百强企业，LTPS手机面板出货量全球**，LCD全面屏出货量全球**，中小尺寸显示领域龙头企业员工超过18000人\n\n是服务于国家战略新兴产业、显示产业的高科技企业，手机是中国航空工业集团旗下骨干企业，成立于1983年，1995年上市。近年来投资500亿元奠定了雄厚发展基础，目前产线组合完善，产业基地分布在深圳、厦门、上海、成都、武汉等地，并在美国、德国、日本、韩国、台湾、香港等主要发达国家与地区设有全球营销网络和技术服务支持平台。\n\n二、招聘条件\n\n1.初中及以上学历，会写26个英文字母;\n\n2.年龄要求16-40岁；\n\n3.个人有效身份证；\n\n4.身体健康，身高不低于1.5米，无色盲色弱，无明显纹身，需穿无尘服；\n\n5.性格外向，表达能力强，分析能力强，积极上进、吃苦耐劳，有强烈的学习欲望、具备相应的学习能力\n\n三、薪资待遇\n\n1.每月15日发放薪资；\n\n2.同工同酬，带薪培训；\n\n3.月综合工资4200-6000；\n\n4.保险：五险一金（按百分之八比例交）’\n\n5.餐补420元每月，3月份餐补800；\n\n6.工资结构：基本工资+加班费+岗位补贴+绩效奖金+餐补+夜班补贴=综合工资；\n\n7.岗位津贴一般岗位100-750；重要岗位150-1050；关键岗位350-1350（单位：元/月）\n\n8.绩效标准：一般岗位0-300元/月；重要岗位0-450元/月；关键岗位0-900元/月（转正后，考取上岗证）\n\n四、住宿条件\n\n4-6人间空调宿舍，配空调、网线、浴室、太阳能热水器、洗手间和阳台、免住宿费，仅需要承担水电费及物业管理费\n\n五、晋升空间\n\n新员工-多能工-全技能员-初级技术员-中级技术员-高级技术员-助理工程师（有岗位津贴100-1350）\n\n六、员工福利\n\n1.带薪休假：年假、婚假、丧假、产假、陪产', 2, 4, ' 可穿戴设备 电子/半导体', '2020-06-04', 1);
INSERT INTO `positions` VALUES (32, '量测技术员 ', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 5, 4, 3, '1.产品首件及巡检尺寸测量 ;    \n\n2.新产品量测 ;    \n\n3.异常尺寸量测识别与分析', 2, 2, ' 硬件制造', '2020-06-04', 1);
INSERT INTO `positions` VALUES (33, '机器学习工程师', '深圳市南山区', 5, 6, 3, '1.本岗位负责公司工业互联网平台中智能算法的研发。包括应用场景分析、数据分析、建模、算法部署等工作；\n\n2. 利用先进的数据分析及机器学习技术，解决典型的行业挑战；从大数据角度分析行业需求，抽象形成机器学习问题并设计算法；基于大数据基础平台（如Spark/Hadoop)，实现机器学习模型的落地，为客户带来价值。\n\n\n\n任职要求：\n\n1.数学、物理、统计、计算机、自动化等理工类专业，硕士及以上学历\n\n2.精通数据挖掘/机器学习算法，有丰富的实践经验；\n\n3.熟练使用python，SQL\n\n4.具有清晰的系统思维逻辑，对解决行业实际问题有浓厚兴趣；\n\n5.良好的沟通和分析问题与解决问题能力。\n\n优先条件：\n\n1.发表学术论文，有项目经验者优先。', 2, 3, ' 大数据 算法 数据挖掘', '2020-06-04', 1);
INSERT INTO `positions` VALUES (34, '产品经理', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 8, 5, 6, '1、 负责连锁零售品牌的移动OA产品（类似阿里钉钉、企业微信），主动思考未来在移动化管理、远程协作、标准化作业、远程培训等业务的走向；\n\n2、 协调内、外部开发和测试资源，完成产品的推进和运营，控制项目进度，如期进入实施阶段；\n\n3、 通过各种渠道收集用户反馈信息，规划产品升级迭代方案；\n\n\n\n岗位要求：\n\n1、 有泛OA产品（IM/考勤/任务日程/在线培训等）、企业级saas产品经验；\n\n2、 对新零售有一定认知，并抱有浓厚的兴趣；\n\n3、 计算机相关专业，本科及以上学历优先；\n\n4、 熟练使用Axure、Xmind、Visio、Photoshop；\n\n5、 具有较强的沟通能力，逻辑思维能力和文档编写能力；\n\n6、 掌握需求分析方法，熟悉需求管理和研发过程管理；\n\n7、 较强的责任心及团队合作精神，能够承担工作压力；', 2, 2, ' 教育 产品设计 用户研究 需求分析', '2020-06-04', 1);
INSERT INTO `positions` VALUES (35, '行政助理', '北京朝阳区闲徕互娱公司朝阳区红军营南路西口汇中广场', 6, 5, 3, '1.     专业不限；\n\n2.     开朗、大方端庄，善于与人沟通；\n\n3.     能适应出差。\n\n负责公司对外展示与接待等后勤工作，协助销售部门开展销售工作。', 2, 4, ' 助理 文案', '2020-06-05', 1);
INSERT INTO `positions` VALUES (36, '销售助理', '深圳市南山区', 6, 5, 3, '1.     专业不限；\n\n2.     性格外向，自律性强，热爱销售，有意向挑战高薪，有特长优先；\n\n协助销售经理推进销售工作，包括前期预约、中期拜访、后期维护等，以及领导交代的其他工作。', 2, 3, ' 销售 助理', '2020-06-05', 1);
INSERT INTO `positions` VALUES (40, 'VR/AR内容制作岗', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 3, 6, 6, '1、根据项目要求制作符合VR/AR展示的场景、模型；\n\n2、完成项目中的模型、材质、纹理贴图制作；\n\n3、完成与后期制作的沟通，确保交付最终VR/AR产出物', 2, 4, ' 3D Max PS', '2020-06-04', 1);
INSERT INTO `positions` VALUES (41, '中级JAVA工程师', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼', 6, 5, 5, '1、3年以上java服务器端软件开发经验，具有扎实的Java编程功底和良好的编码习惯 \r\n2、熟悉MySQL的使用以及SQL优化，有大规模高并发环境下MySQL优化经验优先。 \r\n3、熟悉Redis等NoSQL技术 \r\n4、熟练掌握Spring、Spring Boot、Mybatis等主要技术框架； \r\n5、熟悉HTML、CSS、XML、JSON等技术，熟练掌握JS/JQuery, AJAX等前端技术 \r\n6、熟悉Linux、git相关基础知识 \r\n7、良好的沟通能力，有团队合作合作精神，责任心强 \r\n8、熟悉Docker，有微服务开发经验者优先', 2, 2, ' Java SpringBoot vue', '2020-06-06', 1);
INSERT INTO `positions` VALUES (42, '初级JAVA工程师', '深圳市南山区', 6, 5, 2, '1、3年以上java服务器端软件开发经验，具有扎实的Java编程功底和良好的编码习惯 \r\n2、熟悉MySQL的使用以及SQL优化，有大规模高并发环境下MySQL优化经验优先。 \r\n3、熟悉Redis等NoSQL技术 \r\n4、熟练掌握Spring、Spring Boot、Mybatis等主要技术框架； \r\n5、熟悉HTML、CSS、XML、JSON等技术，熟练掌握JS/JQuery, AJAX等前端技术 \r\n6、熟悉Linux、git相关基础知识 \r\n7、良好的沟通能力，有团队合作合作精神，责任心强 \r\n8、熟悉Docker，有微服务开发经验者优先', 2, 3, 'JavaScript Java SpringBoot vue', '2020-04-18', 1);
INSERT INTO `positions` VALUES (43, '高级java工程师', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 5, 5, 5, '1、3年以上java服务器端软件开发经验，具有扎实的Java编程功底和良好的编码习惯 \r\n2、熟悉MySQL的使用以及SQL优化，有大规模高并发环境下MySQL优化经验优先。 \r\n3、熟悉Redis等NoSQL技术 \r\n4、熟练掌握Spring、Spring Boot、Mybatis等主要技术框架； \r\n5、熟悉HTML、CSS、XML、JSON等技术，熟练掌握JS/JQuery, AJAX等前端技术 \r\n6、熟悉Linux、git相关基础知识 \r\n7、良好的沟通能力，有团队合作合作精神，责任心强 \r\n8、熟悉Docker，有微服务开发经验者优先', 2, 2, 'java vue SpringBoot JavaScript ', '2020-04-18', 1);
INSERT INTO `positions` VALUES (44, 'Android/IOS', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 5, 5, 5, '1、负责社区产品的研发和性能优化，完成高质量编码和测试；\n2、负责与产品同学配合，深度参与产品需求讨论和功能定义；\n3、负责参与移动技术框架的设计选型，实现关键技术点；\n岗位要求：\n1、本科及以上学历，2年以上Android/iOS开发经验； 熟练使用Git，Android Studio/XCode及性能调优工具；\n2、熟练使用Android/iOS常用API，理解系统体系结构及UI绘制原理；\n3、精通Java/Obj-C多线程开发，熟悉Http/Socket工作原理，常用数据交换格式；\n4、积极乐观，责任心强，具有良好的团队沟通与协作能力；\n5、有系统源码研究、架构设计及自定义UI控件经验优先；\n6、有较好的产品思维优先；', 2, 2, 'UI控件 系统源码 ui绘制 Android Studio', '2020-04-18', 1);
INSERT INTO `positions` VALUES (45, '游戏策划', '北京朝阳区闲徕互娱公司朝阳区红军营南路西口汇中广场', 8, 5, 4, '1. 负责游戏主体框架结构设计，设定核心玩法和系统规则；\n2. 负责用户日常游戏目标，产出、消耗等系统的规划和整体设计；\n3. 制定项目进度，安排、监督、指导下属策划的工作，协调技术完成对应开发内容，推动项目开发工作顺利进行；\n4. 负责提及把控输出策划设计方案的质量和效率；\n5. 把控游戏的产品质量、美术风格、技术要求等产品关键指标。\n任职要求：\n1. 3年以上游戏策划经验，有0-1的过程；\n2. 对游戏有深刻的认识和理解，游戏经验丰富，熟悉多种类型游戏；\n3. 良好的沟通、理解和语言表达能力，文字功底扎实，逻辑敏捷、思维清晰；\n4. 性格开朗、情绪稳定，工作积极主动，较好的工作抗压能力；\n5. 有桌游或棋类游戏开发经验者优先。', 2, 3, '核心玩法 游戏经验 美术风格 桌游 框架结构设计', '2020-04-18', 1);
INSERT INTO `positions` VALUES (46, '测试开发工程师 ', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 8, 5, 5, '工作职责：\n1、根据需求设计测试用例，对需求有一定的敏感度；\n2、参与Web和App等方向的接口、功能测试工作，提交缺陷并进行验证，积极推动并协助开发人员跟踪、重现、修正缺陷；\n3、熟悉jemter工具能熟练使用工具进行接口及性能测试并对测试结果进行分析；\n4、学习掌握需求的测试工具及新技术，并运用到实际的工作中。\n5、熟悉接口自动化，并运用到实际的工作中提高工作效率。\n任职资格：\n1、计算机、软件等相关专业，有性能测试或Web以及app接口自动化测试经验者优先；\n2、熟悉Java/python等至少一种编程语言，熟练使用一种脚本语言；\n3、熟悉Linux或类unix的系统，能够熟练使用常见的命令，对操作系统原理熟悉优先；\n4、熟悉数据库原理，能够熟练使用常见的SQL语句，对Mysql性能优化有经验优先；\n5、有良好的团队合作意识、沟通表达能力和协调能力,能够承受一定压力。', 2, 2, '系统架构 后端开发 搜索架构 unix平台 网络编程', '2020-04-29', 1);
INSERT INTO `positions` VALUES (47, '高级java开发工程师（银行系统）', '北京朝阳区闲徕互娱公司朝阳区红军营南路西口汇中广场', 6, 5, 7, '1.熟练掌握JAVA语言；\n2.熟练掌握Spring开发，能够在Spring/Spring boot/Spring等开发框架下开发应用；\n3.熟悉Linux常用命令,掌握在Linux下进行开发部署测试； \n4.掌握基于Oracle、Mysql等关系型数据库的模型设计与开发；\n5.了解HTML、JS、JSP、CSS等前端框架； \n6.能够使用IDEA/Eclipse、Git/ClearCase或同类开发及版本管理工具； \n7.熟悉软件的分析、设计、开发、测试（单元测试，组件测试）、部署和运维基本知识，具备相关经验者从优录用；\n8.有银行、保险、基金、积分相关从业经验者从优录用', 2, 4, 'java vue SpringBoot JavaScript ', '2020-06-04', 1);
INSERT INTO `positions` VALUES (48, 'Android/ios客户端开发工程师', '深圳市南山区', 8, 5, 5, '岗位职责：\n\n1、负责混合式移动APP的开发；\n\n2、对现有的移动APP进行优化，包括优化APP性能，提升APP的用户体验；\n\n3、积极响应客户需求并进行开发/定制化开发和交付；\n\n4、参与公司产品的架构优化，性能优化并辅助其他模块进行技术实现；\n\n5、协助并完成其他各类技术开发任务。\n\n\n\n任职资格：\n\n1、全日制大学本科及以上学历，35周岁以下；\n\n2、计算机类相关专业；\n\n3、有相关行业工作经验；\n\n4、精通Javascript、HTML5、CSS，有混合开发经验者优先；\n\n5、熟悉Android及iOS平台应用开发，熟悉常用布局，了解设计规范；\n\n6、熟悉Android及iOS 操作系统体系结构、framework、以及底层库；\n\n7、具备一定的移动端系统分析和系统架构设计能力。\n\n优先条件:\n\n1、有智能POS前端APP开发经验者优先；\n\n2、有手机APP开发经验者优先。\n\n', 2, 3, 'UI控件 系统源码 ui绘制 Android Studio', '2020-06-04', 1);
INSERT INTO `positions` VALUES (49, '前端高级开发工程师', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 8, 5, 5, '1.负责平台类产品的Web前端研发；\n\n2.负责产品体验、性能改进和Web界面技术优化；\n\n3.探索数据可视化、多维分析等领域在大数据产品上的应用', 2, 4, ' HTML5 css', '2020-06-04', 1);
INSERT INTO `positions` VALUES (50, '高级java开发工程师', '深圳市南山区', 6, 5, 5, '岗位职责：\n\n1、根据客户需求，在规定的工期与质量要求下，进行产品模块级或功能级的设计与编码，为项目交付提供保障；\n\n2、在Devops工程指导思想下，与开发上下游密切协作，参与单元测试、各环节评审等质量保障工作，不断提升产品的品质，提升用户体验；\n\n3、解决客户在使用产品过程中遇到的技术疑难问题。\n\n \n\n工作要求：\n\n1、计算机或相关专业，全日制统招一本以上；5年及以上工作经验；\n\n2、精通java开发技术，掌握微服务知识及相关技术框架（如Dubbo等），且有相关的项目经验及分布式开发实践；\n\n3、掌握数据库原理，至少具有5年及以上MySQL、Oracle、sql server等其中一种数据库在大型系统中的使用经验；\n\n4、熟悉js、html5、css等前端技术；\n\n5、富有创新意识，善于思考，具有优秀的解决问题能力、良好的组织沟通能力及团队协作精神；\n\n6、能够较好地践行DevOps思想或具有人力资源系统开发经验者优先考虑。', 2, 4, ' Mysql java 云计算', '2020-06-04', 1);
INSERT INTO `positions` VALUES (51, '区块链应用开发工程师', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼', 8, 5, 5, '负责面向不同应用场景的区块链应用开发和测试。\n\n开发区块链智能合约及相关的开发区块链应用服务。\n\n负责开发行业应用的区块链SaaS服务', 2, 2, ' 银行 python Java', '2020-06-04', 1);
