INSERT INTO `positions` VALUES (54, '区块链应用开发工程师', '北京朝阳区闲徕互娱公司朝阳区红军营南路西口汇中广场', 5, 5, 7, '负责面向不同应用场景的区块链应用开发和测试。\n\n开发区块链智能合约及相关的开发区块链应用服务。\n\n负责开发行业应用的区块链SaaS服务', 2, 2, ' 银行 python Java', '2020-06-04', 1);
INSERT INTO `positions` VALUES (55, '研究院技术项目经理实习生', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 8, 5, 3, '岗位职责】\n\n1、 协助项目经理进行深度学习平台产品开发工作流程的梳理、制定 版本迭代规划\n\n2、对研发中的项目进度跟踪、项目信息同步和风险管理等，保障项目版本目标达成\n\n3、参与深度学习平台产品的体验优化工作，设计产品体验方案并完成用户需求的搜集和转化\n\n\n\n【岗位要求】\n\n1、本科或本科以上学历，计算机或管理类相关专业\n\n2、了解人工智能基本概念\n\n3、责任心强、细致有耐心、逻辑清晰、有良好的沟通能力\n\n4、每周至少出勤4天，全勤优先（特殊情况可酌情请假）\n\n5、有项目管理经验者优先', 4, 3, ' 项目管理', '2020-06-04', 1);
INSERT INTO `positions` VALUES (56, '游戏技术美术（TA）', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 8, 5, 4, '岗位职责：\n\n1、 学习基础游戏美术制作流程及能力；\n\n2、 与美术及程序团队沟通，用引擎实现游戏中美术表现及功能；\n\n3、 学习项目美术工作流程或制作相应美术工具或插件；\n\n4、 能够完成一些基础的设计工作，美术资源输出及最终效果优化。\n\n任职要求：\n\n1、统招2020届本科/研究生，数字媒体技术或动画等专业，热爱游戏行业；\n\n2、有一定的unity使用经验，较好的造型，色彩能力，设计能力；\n\n3、做事踏实，头脑灵活，学习能力强；\n\n4、沟通能力/抗压能力强。\n\n', 2, 2, ' 美术设计', '2020-06-04', 1);
INSERT INTO `positions` VALUES (57, '游戏策划', '北京朝阳区闲徕互娱公司朝阳区红军营南路西口汇中广场', 8, 6, 5, '1. 负责游戏主体框架结构设计，设定核心玩法和系统规则；\n2. 负责用户日常游戏目标，产出、消耗等系统的规划和整体设计；\n3. 制定项目进度，安排、监督、指导下属策划的工作，协调技术完成对应开发内容，推动项目开发工作顺利进行；\n4. 负责提及把控输出策划设计方案的质量和效率；\n5. 把控游戏的产品质量、美术风格、技术要求等产品关键指标。\n任职要求：\n1. 3年以上游戏策划经验，有0-1的过程；\n2. 对游戏有深刻的认识和理解，游戏经验丰富，熟悉多种类型游戏；\n3. 良好的沟通、理解和语言表达能力，文字功底扎实，逻辑敏捷、思维清晰；\n4. 性格开朗、情绪稳定，工作积极主动，较好的工作抗压能力；\n5. 有桌游或棋类游戏开发经验者优先。', 2, 2, '核心玩法 游戏经验 美术风格 桌游 框架结构设计', '2020-04-18', 1);
INSERT INTO `positions` VALUES (58, '测试开发工程师 ', '北京海淀区融科资讯中心A座3搂', 8, 5, 7, '工作职责：\n1、根据需求设计测试用例，对需求有一定的敏感度；\n2、参与Web和App等方向的接口、功能测试工作，提交缺陷并进行验证，积极推动并协助开发人员跟踪、重现、修正缺陷；\n3、熟悉jemter工具能熟练使用工具进行接口及性能测试并对测试结果进行分析；\n4、学习掌握需求的测试工具及新技术，并运用到实际的工作中。\n5、熟悉接口自动化，并运用到实际的工作中提高工作效率。\n任职资格：\n1、计算机、软件等相关专业，有性能测试或Web以及app接口自动化测试经验者优先；\n2、熟悉Java/python等至少一种编程语言，熟练使用一种脚本语言；\n3、熟悉Linux或类unix的系统，能够熟练使用常见的命令，对操作系统原理熟悉优先；\n4、熟悉数据库原理，能够熟练使用常见的SQL语句，对Mysql性能优化有经验优先；\n5、有良好的团队合作意识、沟通表达能力和协调能力,能够承受一定压力。', 2, 3, '系统架构 后端开发 搜索架构 unix平台 网络编程', '2020-04-29', 1);
INSERT INTO `positions` VALUES (59, '技术运营实习生 ', '深圳市南山区', 6, 5, 5, '职位职责： \n1、技术培训的支持，需求收集、讲师沟通、课程打磨等培训工作； \n2、技术活动的落地，策划、宣传、组织、复盘等设计工作； \n3、视频课程的后期，剪辑视频、线上发布及运营等维护工作； \n4、完成上级安排的其他工作。 \n\n职位要求： \n1、具备良好的协调、沟通和抗压能力； \n2、做事踏实、细致、认真，执行力强； \n3、熟练使用办公软件，有后期制作基础、Pr、AE、PS、AI至少能熟练操作其中两项； \n4、本科及以上学历，大三及研究生优先； \n5、一周可工作4天以上，并可长期实习（3个月及以上）', 4, 2, ' 技术运营 实习', '2020-06-04', 1);
INSERT INTO `positions` VALUES (60, '量测技术员 ', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼', 5, 4, 3, '1.产品首件及巡检尺寸测量 ;    \n\n2.新产品量测 ;    \n\n3.异常尺寸量测识别与分析', 2, 2, ' 硬件制造', '2020-06-04', 1);
INSERT INTO `positions` VALUES (61, '高级ui设计师', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 5, 5, 7, '1. 负责移动端和Web端的UI设计工作，能独立且高品质地完成产品设计任务；\n\n2. 系统化的进行用户需求的调研和分析，参与相关设计流程、设计标准以及视觉元素规范的制定，持续跟进产品的交互、视觉体验优化；\n\n3. 理解业务背景，快速捕捉业务目标，提出产品设计方案和完成UI设计稿，协同上下游推动项目落地，并根据数据及反馈结果，持续优化；\n\n4. 将自己的设计作品及创作过程转述成设计成果，定期进行同行设计竞品案例总结，结合设计与创意的流行趋势，主动发现、思考产品设计存在的问题并积极推进用户体验改善计划', 2, 3, ' UI 视觉', '2020-06-04', 1);
INSERT INTO `positions` VALUES (62, '区块链应用开发工程师', '北京朝阳区闲徕互娱公司朝阳区红军营南路西口汇中广场', 8, 5, 6, '负责面向不同应用场景的区块链应用开发和测试。\n\n开发区块链智能合约及相关的开发区块链应用服务。\n\n负责开发行业应用的区块链SaaS服务', 2, 2, ' 银行 python Java', '2020-06-04', 1);
INSERT INTO `positions` VALUES (63, '高级java开发工程师', '深圳市南山区', 5, 5, 7, '岗位职责：\n\n1、根据客户需求，在规定的工期与质量要求下，进行产品模块级或功能级的设计与编码，为项目交付提供保障；\n\n2、在Devops工程指导思想下，与开发上下游密切协作，参与单元测试、各环节评审等质量保障工作，不断提升产品的品质，提升用户体验；\n\n3、解决客户在使用产品过程中遇到的技术疑难问题。\n\n \n\n工作要求：\n\n1、计算机或相关专业，全日制统招一本以上；5年及以上工作经验；\n\n2、精通java开发技术，掌握微服务知识及相关技术框架（如Dubbo等），且有相关的项目经验及分布式开发实践；\n\n3、掌握数据库原理，至少具有5年及以上MySQL、Oracle、sql server等其中一种数据库在大型系统中的使用经验；\n\n4、熟悉js、html5、css等前端技术；\n\n5、富有创新意识，善于思考，具有优秀的解决问题能力、良好的组织沟通能力及团队协作精神；\n\n6、能够较好地践行DevOps思想或具有人力资源系统开发经验者优先考虑。', 2, 4, ' Mysql java 云计算', '2020-06-04', 1);
INSERT INTO `positions` VALUES (64, '高级java开发工程师', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 5, 5, 6, '岗位职责：\n\n1、在运营领域能独当一面，具有技术牵引驱动业务的能力，能在业务和技术上指导其他同学；\n\n2、愿意接受B端业务逻辑复杂性、海量数据、服务高可用的挑战，推动系统可用性和可扩展性的提升；\n\n3、具有良好的系统抽象能力，在系统中台能力建设方面能提出创新的解决思路和方案，为团队引入创新技术。\n\n岗位要求：\n\n1、计算机或相关专业本科以上学历，有扎实的计算机基础知识和编程功底，5年及以上相关工作经验；\n\n2、有较强的问题解决能力，根据不同的场景可以给出较优的系统解决方案；\n\n3、精通多线程编程，熟悉JVM，熟悉常见的开源分布式中间件、缓存、消息队列等，熟悉MySQL，熟悉大数据处理、olap等，熟悉Linux下的DevOps； \n\n4、有较强的团队沟通协作能力和项目风险管理能力，可以push多团队协作按时交付项目；\n\n5、有丰富的系统架构设计经验，在一线互联网公司负责B端中台建设经验者优先，业务sense良好者优先。', 2, 3, ' 中间件 Linux Java', '2020-06-04', 1);
INSERT INTO `positions` VALUES (65, '高级java开发工程师 ', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼', 8, 5, 7, '岗位要求：\n\n1、Java开发经验5年\n2、使用过dubbo，reids，对分布式有了解\n3、最近项目工作超1年\n\n4、统招本科及以上学历，学信网可查', 2, 3, ' 后端 中间件', '2020-06-04', 1);
INSERT INTO `positions` VALUES (66, '技术运营实习生 ', '深圳市南山区', 8, 5, 3, '职位职责： \n1、技术培训的支持，需求收集、讲师沟通、课程打磨等培训工作； \n2、技术活动的落地，策划、宣传、组织、复盘等设计工作； \n3、视频课程的后期，剪辑视频、线上发布及运营等维护工作； \n4、完成上级安排的其他工作。 \n\n职位要求： \n1、具备良好的协调、沟通和抗压能力； \n2、做事踏实、细致、认真，执行力强； \n3、熟练使用办公软件，有后期制作基础、Pr、AE、PS、AI至少能熟练操作其中两项； \n4、本科及以上学历，大三及研究生优先； \n5、一周可工作4天以上，并可长期实习（3个月及以上）', 4, 2, ' 技术运营 实习', '2020-06-04', 1);
INSERT INTO `positions` VALUES (67, '游戏技术美术（TA）', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼大学东路22号', 6, 5, 3, '岗位职责：\n\n1、 学习基础游戏美术制作流程及能力；\n\n2、 与美术及程序团队沟通，用引擎实现游戏中美术表现及功能；\n\n3、 学习项目美术工作流程或制作相应美术工具或插件；\n\n4、 能够完成一些基础的设计工作，美术资源输出及最终效果优化。\n\n任职要求：\n\n1、统招2020届本科/研究生，数字媒体技术或动画等专业，热爱游戏行业；\n\n2、有一定的unity使用经验，较好的造型，色彩能力，设计能力；\n\n3、做事踏实，头脑灵活，学习能力强；\n\n4、沟通能力/抗压能力强。\n\n', 2, 2, ' 美术设计', '2020-06-04', 1);
INSERT INTO `positions` VALUES (68, '研究院技术项目经理实习生', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼', 6, 5, 3, '岗位职责】\n\n1、 协助项目经理进行深度学习平台产品开发工作流程的梳理、制定 版本迭代规划\n\n2、对研发中的项目进度跟踪、项目信息同步和风险管理等，保障项目版本目标达成\n\n3、参与深度学习平台产品的体验优化工作，设计产品体验方案并完成用户需求的搜集和转化\n\n\n\n【岗位要求】\n\n1、本科或本科以上学历，计算机或管理类相关专业\n\n2、了解人工智能基本概念\n\n3、责任心强、细致有耐心、逻辑清晰、有良好的沟通能力\n\n4、每周至少出勤4天，全勤优先（特殊情况可酌情请假）\n\n5、有项目管理经验者优先', 4, 2, ' 项目管理', '2020-06-04', 1);
INSERT INTO `positions` VALUES (69, '储备技术员', '北京市 朝阳区 北京光华路五号院 世纪财富中心1号楼', 8, 4, 3, '一、公司简介\n\n我们是一家大型国有央企，隶属世界500强，中国电子百强企业，LTPS手机面板出货量全球**，LCD全面屏出货量全球**，中小尺寸显示领域龙头企业员工超过18000人\n\n是服务于国家战略新兴产业、显示产业的高科技企业，手机是中国航空工业集团旗下骨干企业，成立于1983年，1995年上市。近年来投资500亿元奠定了雄厚发展基础，目前产线组合完善，产业基地分布在深圳、厦门、上海、成都、武汉等地，并在美国、德国、日本、韩国、台湾、香港等主要发达国家与地区设有全球营销网络和技术服务支持平台。\n\n二、招聘条件\n\n1.初中及以上学历，会写26个英文字母;\n\n2.年龄要求16-40岁；\n\n3.个人有效身份证；\n\n4.身体健康，身高不低于1.5米，无色盲色弱，无明显纹身，需穿无尘服；\n\n5.性格外向，表达能力强，分析能力强，积极上进、吃苦耐劳，有强烈的学习欲望、具备相应的学习能力\n\n三、薪资待遇\n\n1.每月15日发放薪资；\n\n2.同工同酬，带薪培训；\n\n3.月综合工资4200-6000；\n\n4.保险：五险一金（按百分之八比例交）’\n\n5.餐补420元每月，3月份餐补800；\n\n6.工资结构：基本工资+加班费+岗位补贴+绩效奖金+餐补+夜班补贴=综合工资；\n\n7.岗位津贴一般岗位100-750；重要岗位150-1050；关键岗位350-1350（单位：元/月）\n\n8.绩效标准：一般岗位0-300元/月；重要岗位0-450元/月；关键岗位0-900元/月（转正后，考取上岗证）\n\n四、住宿条件\n\n4-6人间空调宿舍，配空调、网线、浴室、太阳能热水器、洗手间和阳台、免住宿费，仅需要承担水电费及物业管理费\n\n五、晋升空间\n\n新员工-多能工-全技能员-初级技术员-中级技术员-高级技术员-助理工程师（有岗位津贴100-1350）\n\n六、员工福利\n\n1.带薪休假：年假、婚假、丧假、产假、陪产', 2, 2, ' 可穿戴设备 电子/半导体', '2020-06-04', 1);
INSERT INTO `positions` VALUES (70, '游戏策划', '北京朝阳区闲徕互娱公司朝阳区红军营南路西口汇中广场', 5, 5, 4, '1. 负责游戏主体框架结构设计，设定核心玩法和系统规则；\n2. 负责用户日常游戏目标，产出、消耗等系统的规划和整体设计；\n3. 制定项目进度，安排、监督、指导下属策划的工作，协调技术完成对应开发内容，推动项目开发工作顺利进行；\n4. 负责提及把控输出策划设计方案的质量和效率；\n5. 把控游戏的产品质量、美术风格、技术要求等产品关键指标。\n任职要求：\n1. 3年以上游戏策划经验，有0-1的过程；\n2. 对游戏有深刻的认识和理解，游戏经验丰富，熟悉多种类型游戏；\n3. 良好的沟通、理解和语言表达能力，文字功底扎实，逻辑敏捷、思维清晰；\n4. 性格开朗、情绪稳定，工作积极主动，较好的工作抗压能力；\n5. 有桌游或棋类游戏开发经验者优先。', 2, 2, '核心玩法 游戏经验 美术风格 桌游 框架结构设计', '2020-04-18', 1);
INSERT INTO `positions` VALUES (71, '测试开发工程师 ', '北京海淀区融科资讯中心A座3搂', 5, 5, 5, '工作职责：\n1、根据需求设计测试用例，对需求有一定的敏感度；\n2、参与Web和App等方向的接口、功能测试工作，提交缺陷并进行验证，积极推动并协助开发人员跟踪、重现、修正缺陷；\n3、熟悉jemter工具能熟练使用工具进行接口及性能测试并对测试结果进行分析；\n4、学习掌握需求的测试工具及新技术，并运用到实际的工作中。\n5、熟悉接口自动化，并运用到实际的工作中提高工作效率。\n任职资格：\n1、计算机、软件等相关专业，有性能测试或Web以及app接口自动化测试经验者优先；\n2、熟悉Java/python等至少一种编程语言，熟练使用一种脚本语言；\n3、熟悉Linux或类unix的系统，能够熟练使用常见的命令，对操作系统原理熟悉优先；\n4、熟悉数据库原理，能够熟练使用常见的SQL语句，对Mysql性能优化有经验优先；\n5、有良好的团队合作意识、沟通表达能力和协调能力,能够承受一定压力。', 2, 3, '系统架构 后端开发 搜索架构 unix平台 网络编程', '2020-04-29', 1);
INSERT INTO `positions` VALUES (72, '高级java开发工程师（银行系统）', '北京', 8, 5, 7, '1.熟练掌握JAVA语言；\n2.熟练掌握Spring开发，能够在Spring/Spring boot/Spring等开发框架下开发应用；\n3.熟悉Linux常用命令,掌握在Linux下进行开发部署测试； \n4.掌握基于Oracle、Mysql等关系型数据库的模型设计与开发；\n5.了解HTML、JS、JSP、CSS等前端框架； \n6.能够使用IDEA/Eclipse、Git/ClearCase或同类开发及版本管理工具； \n7.熟悉软件的分析、设计、开发、测试（单元测试，组件测试）、部署和运维基本知识，具备相关经验者从优录用；\n8.有银行、保险、基金、积分相关从业经验者从优录用', 2, 2, 'java vue SpringBoot JavaScript ', '2020-06-04', 1);
INSERT INTO `positions` VALUES (73, 'Android/ios客户端开发工程师', '广州', 8, 5, 5, '岗位职责：\n\n1、负责混合式移动APP的开发；\n\n2、对现有的移动APP进行优化，包括优化APP性能，提升APP的用户体验；\n\n3、积极响应客户需求并进行开发/定制化开发和交付；\n\n4、参与公司产品的架构优化，性能优化并辅助其他模块进行技术实现；\n\n5、协助并完成其他各类技术开发任务。\n\n\n\n任职资格：\n\n1、全日制大学本科及以上学历，35周岁以下；\n\n2、计算机类相关专业；\n\n3、有相关行业工作经验；\n\n4、精通Javascript、HTML5、CSS，有混合开发经验者优先；\n\n5、熟悉Android及iOS平台应用开发，熟悉常用布局，了解设计规范；\n\n6、熟悉Android及iOS 操作系统体系结构、framework、以及底层库；\n\n7、具备一定的移动端系统分析和系统架构设计能力。\n\n优先条件:\n\n1、有智能POS前端APP开发经验者优先；\n\n2、有手机APP开发经验者优先。\n\n', 2, 4, 'UI控件 系统源码 ui绘制 Android Studio', '2020-06-04', 1);
INSERT INTO `positions` VALUES (74, '前端高级开发工程师', '广州', 6, 5, 5, '1.负责平台类产品的Web前端研发；\n\n2.负责产品体验、性能改进和Web界面技术优化；\n\n3.探索数据可视化、多维分析等领域在大数据产品上的应用', 2, 3, ' HTML5 css', '2020-06-04', 1);
INSERT INTO `positions` VALUES (75, '高级java开发工程师 ', '深圳', 5, 5, 7, '岗位要求：\n\n1、Java开发经验5年\n2、使用过dubbo，reids，对分布式有了解\n3、最近项目工作超1年\n\n4、统招本科及以上学历，学信网可查', 2, 4, ' 后端 中间件', '2020-06-04', 1);
INSERT INTO `positions` VALUES (76, '技术运营实习生 ', '北京', 2, 5, 3, '职位职责： \n1、技术培训的支持，需求收集、讲师沟通、课程打磨等培训工作； \n2、技术活动的落地，策划、宣传、组织、复盘等设计工作； \n3、视频课程的后期，剪辑视频、线上发布及运营等维护工作； \n4、完成上级安排的其他工作。 \n\n职位要求： \n1、具备良好的协调、沟通和抗压能力； \n2、做事踏实、细致、认真，执行力强； \n3、熟练使用办公软件，有后期制作基础、Pr、AE、PS、AI至少能熟练操作其中两项； \n4、本科及以上学历，大三及研究生优先； \n5、一周可工作4天以上，并可长期实习（3个月及以上）', 4, 2, ' 技术运营 实习', '2020-06-04', 1);
INSERT INTO `positions` VALUES (77, '游戏技术美术（TA）', '北京', 5, 5, 3, '岗位职责：\n\n1、 学习基础游戏美术制作流程及能力；\n\n2、 与美术及程序团队沟通，用引擎实现游戏中美术表现及功能；\n\n3、 学习项目美术工作流程或制作相应美术工具或插件；\n\n4、 能够完成一些基础的设计工作，美术资源输出及最终效果优化。\n\n任职要求：\n\n1、统招2020届本科/研究生，数字媒体技术或动画等专业，热爱游戏行业；\n\n2、有一定的unity使用经验，较好的造型，色彩能力，设计能力；\n\n3、做事踏实，头脑灵活，学习能力强；\n\n4、沟通能力/抗压能力强。\n\n', 2, 3, ' 美术设计', '2020-06-04', 1);
INSERT INTO `resume` VALUES (1, '自学本事强，善于思考，吃苦耐劳，有良好的沟通本事，善于与他人相处，富有团队合作精神，热爱运动。但人非完人，自我在某些方面还是有必须的不足，比如知识，社会经验等;可是我相信这些都是能够经过自我努力的学习来提高的，我也正朝着这个方向努力!能吃苦耐劳，愿从基层做起;以团体利益为第一原则，遵守公司的规章制度。', '记得记得就觉得', '/api/file/resume/aa5546ee-b210-4c54-aeef-8dcb5a44bdd4小明-简历.pdf');
INSERT INTO `resume` VALUES (4, '热情随和，活波开朗，具有进取精神和团队精神，有较强的动手本事。良好协调沟通本事，适应力强，反应快、进取、灵活，爱创新!提高自我，适应工作的需要。所以我期望找一份与自身知识结构相关的工作，具有必须的社会交往本事，具有优秀的组织和协调本事。在学习中，我注重理论与实践的结合，己具备了相当的实践操作本事。熟练操作计算机办公软件。很强的事业心和职责感使我能够应对任何困难和挑战。', '', '/api/file/resume/aa5546ee-b210-4c54-aeef-8dcb5a44bdd4李芳-简历.pdf');
INSERT INTO `resume` VALUES (5, '为人乐观开朗，进取向上，勤奋努力，有团队合作精神，有职责心有耐心够细心。作为初学者，我具备出色的学习本事并且乐于学习、敢于创新，不断追求卓越;作为参与者，我具备诚实可信的品格、富有团队合作精神。期望经过工作自我能够得到必须的锻炼，丰富自身。', NULL, '/api/file/resume/acdef7f1-e4f7-4059-8d90-b430c28d88f4Java 8实战.pdf');
INSERT INTO `resume` VALUES (6, '本人性格开朗，爱好广泛，在学习期间进取参加各种活动，多次组织一些学校活动。进取向上且对待工作认证负责，有上进心，勤于学习能不断提高，喜欢向高难度挑战，提升自身的本事与综合素质。我是一个很有时间观念的人，能进取认真做好每件事，不怕辛苦不怕累，更不怕挫折，待人真诚，善于沟通、协调，有较强的组织本事与团队精神。期望贵公司能给我一个学习和锻炼的平台，我会好好把握。', NULL, '/api/file/resume/aa5546ee-b210-4c54-aeef-8dcb5a44bdd4王宝东-简历.pdf');
INSERT INTO `resume` VALUES (7, '本人诚信开朗，热情真诚，团队意识强，时间观念强，易于理解新事物，乐于与人沟通，较强的适应本事和协调本事，能恪守以大局为重的原则。在学校生活期间，曾担任学校广播站站长，让我的组织协调本事、管理本事、应变本事、团队合作精神大大提升，使我具备良好的心理素质。进入社会工作之后，已慢慢学会耐心、用良好的感知为客户解答问题，已磨练出较强的忍耐力和意志力。', NULL, NULL);
INSERT INTO `resume` VALUES (8, '一向以来，努力、进取、乐观、拼搏是我的人生信条，我相信，我会一向努力下去，做好自我，奉献社会。敢做敢拼，脚踏实地;做事认真负责，职责心强;座右铭是“优秀是一种习惯”我的期望是在企事业单位从事管理、金融、行政、助理等与专业相关方面的工作。爱好所学专业，乐于学习新知识;对工作有职责心;踏实，热情，对生活充满活力;主动性强，自学本事强，具有团队合作意识，有必须组织本事;抗压本事强，能够快速适应周围环境。', NULL, NULL);
INSERT INTO `resume` VALUES (9, '有自我独特的想法这是我最大的优点，并且我多才多艺，我相信我能胜任任何工作!\r\n\r\n　　我梦想就是能实现我的个人价值的挖掘，能让我的价值得到最大实现，同时实现企业利润和价值的最大化。从基层做起，不断学习，一点一滴积累经验，努力提升自我。丛基层技术做起，向管理层迈进。', NULL, NULL);
INSERT INTO `resume` VALUES (10, '本人有着较强的沟通表达本事，对工作有上进心、认真负责、待人真诚、处人随和!换位思考有自我独特的想法这是我最大的优点，并且我多才多艺，我相信我能胜任任何工作!我梦想就是能实现我的个人价值的挖掘，能让我的价值得到最大实现，同时实现企业利润和价值的最大化。从基层做起，不断学习，一点一滴积累经验，努力提升自我。丛基层技术做起，向管理层迈进。', NULL, NULL);
INSERT INTO `resume` VALUES (11, '　本人性格开朗，为人细心，做事一丝不苟，能吃苦耐劳，工作脚踏实地，有较强的职责心，具有团队合作精神，又具有较强的独立工作本事，思维活跃，能独挡一面。\r\n\r\n同时本人有较强的沟通本事及管理本事，期望能尽快收到面试通知，应对面与您详细交谈，凭借多年的丰富阅历与实战经验，我敢保证，我将给您提交一份满意的答卷。', NULL, NULL);
INSERT INTO `resume` VALUES (12, '本人性格开朗具亲和力，乐观耿直，诚实守信，有良好的心理素质，环境适应性强，有吃苦的精神，做事有毅力，喜欢挑战，行事进取认真富有职责心;能够注意统筹安排，进行有效的自我管理;注重团队协作，善于沟通协调;学习本事强，并喜欢学习和理解新事物，深信有耕耘就会有收获。凭着年轻，我会不懈努力，让自我做得更好。给我一个舞台，我会给你满意的表现。相信年轻，相信自我!您的信任与我的实力将为我们带来共同的成功!\r\n\r\n　　诚实守信，待人处事热情大方，性格开朗，能很快理解新事物，富有创新和开拓意识，勇于挑战自我，有较强的时间观念和职责心，善于思考，虚心向学，并始终坚持严于律己，宽以待人，懂得“若要人敬己，先要己敬人”的道理，良好的人际关系和丰富的专业知识为我的成功之路作了铺垫。', NULL, NULL);
