INSERT INTO `sheet_exam` VALUES (1, '\n1.内存模型，\n2.谈谈了解的集合，arraylist和linkedlist区别，使用场景，concurrenthashmap讲一下。\n3.线程同步的方式，synchronized和lock有啥区别，volatile讲一下，AtomicInteger怎么自增的，cas自旋\n4.垃圾回收算法，回收机制。\n5.myisam和innodb的区别，事务的隔离级别，索引讲一下，什么情况下用索引\n6.string， stringbuilder和stringbuffer有啥不一样\n7.手撕代码就很简单的算法，忘了\n8.平时怎么自学java的，通过哪些途径。\n9.redis了解么，rdb和aof的区别，slot有什么作用\n10.NIO了解么，讲一下\n11.线程池了解么，各个参数干嘛的，具体讲一下\n12.TCP和UDP区别，三次握手四次挥手，如何保证可靠性，拥塞控制讲一下', 80, '2020-04-29', '14:00:00', 60, '');
INSERT INTO `sheet_exam` VALUES (3, '1.项目相关\r\n之后就围绕缓存/redis问了很久\r\n2.redis 的并发竞争问题是什么？如何解决这个问题？了解 redis 事务的 CAS 方案吗？（因为项目有用到redis）\r\n3.Redis和mem***区别，为什么用redis巴拉巴拉。好像我会的redis相关的都被问到了\r\n\r\n1.项目，实验室课题\r\n2.ThreadLocal原理，你为什么要用，还有替代的方案保存用户信息吗，有没有考虑过用户很多时这几种方案分别的代价有多大。\r\n3.缓存问题，缓存一致性，并发竞争。项目里缓存的设计想法有参考什么吗。\r\n4.设计时考虑过预计的并发量吗，如何考虑，分别怎么处理\r\n5.秒杀应用需要获取系统时间，那如果有很多台服务器，时间怎么同步，误差怎么办。\r\n6.TCP拥塞控制\r\n7.TCP和udp的区别', 75, '2020-05-06', '09:30:00', 90, NULL);
INSERT INTO `sheet_exam` VALUES (4, '1.怎么学的java啊（感觉都爱问我这个，因为我java是纯自学吧，想通过这个看我都学了啥然后决定提什么样的问题）\r\n2.设计模式了解么，单例讲一下，懒汉饿汉double-check，怎么实现。策略模式，***模式，适配器模式，装饰器模式，分别讲一下\r\n3.联合索引什么时候不会触发索引\r\n4.AOP了解么，有什么好处，如何使用，怎么实现的\r\n5.支付宝到银行的转账业务怎么实现，  瞎扯一通\r\n6.redis实现分布式锁， 瞎扯一通\r\n7.三台机器集群，按不同权重访问，怎么做', 90, '2020-05-07', '11:30:00', 60, NULL);
INSERT INTO `sheet_exam` VALUES (5, '1.聊项目 项目细节，如何继续改进\r\n2.做过哪些项目，使用什么做的\r\n3.看过哪些计算机方面的书\r\n\r\n计网与操作系统：\r\n4.讲一下异步io\r\n5.有几种网络io\r\n6.同步和异步，阻塞和非阻塞\r\n7.多路复用\r\n\r\n数据库：\r\n8.什么是事务\r\n9.事务的几种隔离级别\r\n10.什么是幻读\r\n11.什么情况下会发生幻读', 85, '2020-05-13', '15:00:00', 90, NULL);
INSERT INTO `sheet_exam` VALUES (6, '开始自我介绍\r\n问了项目 答的不太好\r\n然后 差不多问了这些：\r\nspring IOC aop\r\n事务隔离级别\r\n数据库优化\r\n数据库索引\r\n为什么用b树 为什么用b+树 为什么不用红黑树\r\nb树b+树区别\r\n字符串拼接\r\n泛型\r\n内存溢出怎么办\r\n计算机网络http协议\r\njvm内存模型\r\narraylist 和linkedlist区别\r\nhashmap底层\r\n怎么查找一个链表倒数第k个\r\n怎么检查链表是否成环\r\n数据库mvcc', 95, '2020-05-14', '10:00:00', 60, NULL);
